$(".js-autocomplete").on("click", function () {

  $('.dropdown-list-wrapper').slideUp(100);

  if(!$('.flight-autocomplete').hasClass('is-pressed')){
    $(this).select();
    var popularBox = $(this).siblings('.flight-popular-box');
    popularBox.addClass('is-active');
    $(this).autocomplete({
      autoFocus: true,
      source: function(request, response){
        popularBox.removeClass('is-active');
        var searchTerm = request.term.toLowerCase();
        var ret = [];
        $.each(airports, function(i, airportItem){
          $.each(airportItem, function(i, subItem){
            if (subItem.location.toLowerCase().indexOf(searchTerm) === 0)
            ret.push(subItem.location);
          });
        });
        response(ret);
        $('.flight-autocomplete').addClass('is-active').scrollTop(0);
      }
    }).autocomplete("widget").addClass("flight-autocomplete");
  }
}).on("blur", function () {
  $(this).siblings('.flight-popular-box').removeClass('is-active');
  $('.flight-autocomplete').removeClass('is-pressed');
}).on("keydown", function () {
  $(this).siblings('.flight-popular-box').removeClass('is-active');
  $('.flight-autocomplete').removeClass('is-active').addClass('is-pressed');
});

$(".js-autocomplete-basic").on("click", function () {
  if(!$('.basic-autocomplete').hasClass('is-pressed')){
    $(this).select();
    var popularBox = $(this).parent().siblings('.basic-popular-box');
    popularBox.addClass('is-active');
  }
}).on("blur", function () {
  $(this).parent().siblings('.basic-popular-box').removeClass('is-active');
}).on("keydown", function () {
  $(this).siblings('.basic-popular-box').removeClass('is-active');
});


  $('.js-pick-popular').click(function(event) {
    var _this = $(this);
    var _val = _this.attr('data-value');
    var _parent = _this.parents('.input-wrapper-autocomplete');
    var _autocomp = _parent.find('.js-autocomplete');
    var _siblings = _parent.siblings();
    var _target = _parent.find('input[type="text"]');
    var _checkParent = false;

    if(_parent.length>0){
      _checkParent = true;
    }

    if(_checkParent==true){
      _target.val(_val);
    }
    else{
      var _type = _this.attr('data-type');
      var _val = _this.attr('data-value');
      $('.js-autocomplete.'+_type).val(_val);
    }
      
  });


